import styled from 'styled-components';
import Card from '../Card';

const Container = styled.div`
    width: 55rem;
`;

function CardList({cardlist}) {
    const cards = cardlist ? cardlist.map(card => 
        (<Card key={card.id} meta={card} />)
    ) : [];
    console.log(cards);
    return (<Container>
        {cards}
    </Container>)
}

export default CardList;
